import React from 'react';
import {logo} from '../img';

export default class NavBar extends React.Component{
  render() {
    return (
      <div className="navbar">
        <div>
          <img src={logo} alt="Logo-Flame"/>
          <h3>Matcha</h3>
        </div>
        <div>
          <button className="btn btn-small">LOG IN</button>
        </div>
        <ul>
          <li>Profile</li>
          <li>Settings</li>
          <li>Logou</li>
        </ul>
      </div>
  )}
}
